import { css } from 'lit-element';

export const style = css`
  :host {
    flex: auto;
    display: flex;
    flex-direction: column;
  }
  ::slotted(*) {
    flex: 1 1 auto;
    margin: 10%;
    text-align: center;
    border: black 1px solid;
    border-radius: 20px;
  }
`;
